def map_sections(graph):
    section_map= {}
    row=0
    col=0
    for i in range(len(graph)):
        row+=1
        for j in range(len(graph[i])):
            col+=1
            if graph[i][j] == 1 or graph[i][j]==0:
                continue
            section_map[graph[i][j]]=(i,j)
    return section_map
print(map_sections(graph))
